import React from 'react';
import ReactDom from 'react-dom';
import './index.css';

const first_book = {
  author:'Héctor García',
  title:'Ikigai',
  img:'https://images-na.ssl-images-amazon.com/images/I/51T8OXMiB5L._SX356_BO1,204,203,200_.jpg'
}

const second_book = {
  author:'Héctor García',
  title:'Ikigai',
  img:'https://images-na.ssl-images-amazon.com/images/I/51T8OXMiB5L._SX356_BO1,204,203,200_.jpg'
}

function BookList(){
  return(
    <section className="bookList">
      <div>
        <Book title={first_book.title}
         author={first_book.author} img={first_book.img} />
        <Book title={second_book.title}
         author={second_book.author} img={second_book.img}/>

      </div>
    </section>
  )
}


const Book = (props) =>{
  const {img,title,author,children} = props;
  return (
    <article className='Book'>
       <img src={img} title="" />
      <h1>{title}</h1>
      <h4>{author}</h4>
      {children}
    </article>
  )
}

ReactDom.render(<BookList/>,document.getElementById('root'))
